/**
 * Different types of AnimationMode.
 *
 * @public
 */
enum AnimationMode {
	/**
	 * @public
	 */
	Full = "full",
	/**
	 * @public
	 */
	Basic = "basic",
	/**
	 * @public
	 */
	Minimal = "minimal",
	/**
	 * @public
	 */
	None = "none",
}

export default AnimationMode;
